@thephinsider I loved to see all the young players stepping up.
But I know only the 1st pick might change the future of the franchise.
Its baffling that even when planning to lose they can’t. So it feels like a failure even at that.

@EggyFantastic @T_Cdro @HunterMaher5 @GregMcElroy @OhioStateFB @LSUfootball @ClemsonFB @AlabamaFTBL @GeorgiaFootball @GopherFootball @oregonfootball @Utah_Football @PennStateFball @BUFootball @OU_Football @FloridaGators @AuburnFootball @BadgerFootball @UMichFootball LSU also played an FCS opponent. Ohio State has not.
LSU beat an average Texas team by seven, beat an Auburn team that will have four losses by three; and nearly blew a 20-point lead on Alabama to hang on to win by five.
Ohio State's closest game is a margin of 24 points.

@ParkerMoes It’s just worded wrong. I get what you’re saying but it’s a bad look.

It should say “based of strength of schedule and quality wins, which team deserves to be #1 in power rankings”.

Saying a team that doesn’t have the best record “deserves” the 1 seed is Vikings BS lol
